INSERT INTO duel_client_setting_m VALUES('block_assist_judge','アシスト特技による判定強化の効果を受け取る',replace(replace('接受辅助技能所给予的判定强化效果\r\n','\r',char(13)),'\n',char(10)),'他のプレイヤーから「判定がかなり強化される」アシスト特技が送られた時、その効果を受け取るか選択でき\nます。OFFにすると、自分のライブで「判定がかなり強化される」アシスト特技の効果が適応されなくなりま\nす。','可选择是否接受来自其他玩家，带有「让判定获得某种程度强化」的辅助技能效果。\n设定为OFF时，「让判定获得某种程度强化」这项辅助技能的效果就不会在自己的演唱会产生作用。',0);
INSERT INTO duel_client_setting_m VALUES('cut_fever_time_effect','フィーバータイム時、画面にエフェクトを表示する','FEVER期间会在画面上显示相关特效','フィーバータイム中に画面に専用のエフェクト演出を表示するかの選択ができます。\nOFFにすると、表示されなくなります。','可选择要不要在画面上显示FEVER期间专属的特效。\n设定为OFF时，该特效就不会显示。',2);
INSERT INTO duel_client_setting_m VALUES('mute_stamp_voice','スタンプボイスを再生する','播放表情语音','スタンプのボイス（音声）を再生するか選択できます。\nOFFにすると、スタンプが表示されてもボイスが再生しません。この設定は他のプレイヤーを待っている間、\nスピーカーボタンをタップして変更することも可能です。','可选择是否要播放表情的语音(角色配音)。\n设定为OFF时，即使画面上出现表情也不会听到该表情的语音。此设定可在等待其他玩家期间，\n通过点击音量按钮来变更。',1);
